import React from "react";
import { Col, Row } from "react-bootstrap";

const Empolyees = () => {
  return (
    <>
      <div>AdminDashboard</div>

      <Row>
        <Col md={3}>
          <input type="search" />
        </Col>
        <Col md={3}></Col>
        <Col md={3}>
          <Button></Button>
        </Col>
      </Row>
    </>
  );
};

export default Empolyees;
